- input: "TEXT\x1CC00370056\x1C.TEXT\x1C\x1CF3A\x1CIn response to FEC letter dated:
    6/1/11.  Due to clerical error two contributions should have been posted in the
    30 day Post General Report. They were incorrectly recorded on the January 31 Year
    End Report.  Contributions were received by Campaign Staff on November 2, 2010,
    but were not received until 11/23/10 by the Treasurer.                                                                                                                       In
    response to FEC Letter Dated: 6/7/11. Contributions from the following will be
    refunded on 7/5/11 as excessive contributions. (RE: JA Fischer Distributor/Joan
    Fischer and Michael D Perry)                                                                                         In
    further review the contribution from JA Fischer Distributor was corrected to be
    a contribution from JA Fischer.  It was incorrectly attributed to Joan Fischer.
    This is in request of JA Fischer. \n"
